import React, { useState } from 'react'

const Profile = () => {
  const [formData,setFormData]=useState({
    name:'',
    email:'',
    Password:''
  })
  const handleChange=(e)=>{
    setFormData({formData,[e.target.name]:e.target.value})
  }
  return (
    <div className='h-'>

    <div className='flex flex-col space-y-4 shadow-lg max-w-lg '>
      <h1 className='text-lg font-bold '>Profile</h1>
      <img  src="/images/genz.jpg" alt='' className='h-8 w-8 rounded-lg'/>
      <form>
      <input 
        name='name' 
        type='text'
        value={formData.name} 
        onChange={handleChange}
        />
      <input 
        name='email'
        type='email'
        value={formData.value} 
        onChange={handleChange}
        />
      <input  
        name='password' 
        type='password'
        value={formData.Password}
        onChange={handleChange}
        />
      <button className='bg-gray-700' > UPDATE</button>
      <button className='bg-green-700'> CREATE LIST </button>
              
      </form>
      <div className='flex space-justify'>
        <p className='text-red '>Delete Accounts</p>
        <p className='text-red'>sign out</p>
      </div>
    </div>
          
    </div>
  )
}

export default Profile
